// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;
import AwProgressIndicator from 'viewmodel/AwProgressIndicatorViewModel';
import UiView from 'viewmodel/UiViewViewModel';
import AwLayoutSlot from 'viewmodel/AwLayoutSlotViewModel';
import { AwClick,ExistWhen } from 'js/hocCollection';
const AAwClick = AwClick('a');
const DivExistWhen = ExistWhen('div');



/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/wcagService', () => import('js/wcagService'));
registerDynImportEntry('js/aw.narrowMode.service', () => import('js/aw.narrowMode.service'));
registerDynImportEntry('js/localStorage', () => import('js/localStorage'));
registerDynImportEntry('js/appCtxService', () => import('js/appCtxService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "data": {
        "narrowModeStyle": ""
    },
    "actions": {
        "skipToMainClickEvent": {
            "actionType": "JSFunction",
            "method": "initializeSkipToMain",
            "deps": "js/wcagService"
        },
        "checkNarrowMode": {
            "actionType": "JSFunction",
            "method": "checkNarrowMode",
            "deps": "js/aw.narrowMode.service",
            "outputData": {
                "narrowModeStyle": ""
            }
        },
        "checkShowUserSettingsBarValue": {
            "actionType": "batchJob",
            "steps": [
                {
                    "action": "checkNarrowMode"
                },
                {
                    "action": "getShowUserSettingsBarValueInLocalStorage"
                },
                {
                    "action": "setShowUserSettingsBarValueInCtx"
                }
            ]
        },
        "getShowUserSettingsBarValueInLocalStorage": {
            "actionType": "JSFunction",
            "method": "get",
            "deps": "js/localStorage",
            "inputData": {
                "topic": "showUserSettingsBar"
            },
            "outputData": {
                "showUserSettingsBar": ""
            }
        },
        "setShowUserSettingsBarValueInCtx": {
            "actionType": "JSFunction",
            "method": "updateCtx",
            "deps": "js/appCtxService",
            "inputData": {
                "name": "showUserSettingsBar",
                "value": "{{data.showUserSettingsBar}}"
            }
        },
        "toggleShowUserSettingsBarValueInLocalStorage": {
            "actionType": "JSFunction",
            "method": "publish",
            "deps": "js/localStorage",
            "inputData": {
                "topic": "showUserSettingsBar",
                "data": "{{ctx.showUserSettingsBar}}"
            }
        }
    },
    "dataProviders": {},
    "functions": {},
    "onEvent": [
        {
            "eventId": "aw.windowResize",
            "action": "checkNarrowMode"
        },
        {
            "eventId": "appCtx.update",
            "condition": "name === 'showUserSettingsBar'",
            "action": "toggleShowUserSettingsBarValueInLocalStorage"
        }
    ],
    "ctx": {
        "taskbarfullscreen": {
            "type": "string"
        }
    },
    "i18n": {
        "skipToMainLabel": [
            "UIElementsMessages"
        ]
    },
    "messages": {},
    "conditions": {
        "isTaskbarFullScreen": {
            "expression": "ctx.taskbarfullscreen && ctx.taskbarfullscreen === 'true'"
        }
    },
    "lifecycleHooks": {
        "onMount": "checkShowUserSettingsBarValue"
    },
    "_viewModelId": "CommonRoot",
    "_uniqueViewModelId": "CommonRoot"
};

/*
<div class='sw-column awRoot'>
    <aw-progress-indicator></aw-progress-indicator>
    <nav tabIndex='-1' class='aw-skip-to-main-container' aria-label="i18n.skipToMainLabel">
        <a href='javscript: void(0);' class='aw-skip-to-main' aw-click="actions.skipToMainClickEvent">
            <div class='aw-skip-to-main-text'>{{i18n.skipToMainLabel}}</div>
        </a>
    </nav>
    <div class='sw-row flex-auto'>
        <div class='sw-column flex-auto sw-order-two'>
            <div class='sw-row flex-auto'>
                <div class='aw-layout-flexColumn'>
                    <ui-view></ui-view>
                </div>
            </div>
            <aw-layout-slot name='aw_footer' class='aw-layout-fit' context="data"></aw-layout-slot>
        </div>
        <div exist-when="!conditions.isTaskbarFullScreen" class='flex-shrink sw-order-one'>
            <aw-layout-slot name='aw_globalNavigation' class='aw-layout-fit' context="data"></aw-layout-slot>
        </div>
        <div exist-when="!conditions.isTaskbarFullScreen && data.narrowModeStyle === ''"
            class='flex-shrink sw-order-three'>
            <aw-layout-slot name='aw_rightEdge' context="data"></aw-layout-slot>
        </div>
    </div>
</div>

