const renderFn =(props)=> {
    let subPanelContext = props.subPanelContext ;
    let { viewModel: { data, dataProviders, dispatch, conditions, selectionModels, editHandlers, chartProviders, ports  }, grids, ctx, actions, fields, messages, i18n, formProp, viewPath  } = props;
    data = {...data, dataProviders};
    if( subPanelContext && subPanelContext.fields ){
        fields = { ...fields, ...subPanelContext.fields };
    }
    let $index = null;
    return (
            <div className="sw-column awRoot">
        <AwProgressIndicator>
        </AwProgressIndicator>
        <nav tabIndex="-1" className="aw-skip-to-main-container" aria-label={i18n.skipToMainLabel}>
            <AAwClick href="javscript: void(0);" className="aw-skip-to-main" awClick={AwParseService.instance( "actions.skipToMainClickEvent" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                <div className="aw-skip-to-main-text">
                    {AwParseService.instance( "i18n.skipToMainLabel" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}
                </div>
            </AAwClick>
        </nav>
        <div className="sw-row flex-auto">
            <div className="sw-column flex-auto sw-order-two">
                <div className="sw-row flex-auto">
                    <div className="aw-layout-flexColumn">
                        <UiView>
                        </UiView>
                    </div>
                </div>
                <AwLayoutSlot name="aw_footer" className="aw-layout-fit" context={AwParseService.instance( "data" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                </AwLayoutSlot>
            </div>
            <DivExistWhen className="flex-shrink sw-order-one" existWhen={AwParseService.instance( "!conditions.isTaskbarFullScreen" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                <AwLayoutSlot name="aw_globalNavigation" className="aw-layout-fit" context={AwParseService.instance( "data" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                </AwLayoutSlot>
            </DivExistWhen>
            <DivExistWhen className="flex-shrink sw-order-three" existWhen={AwParseService.instance( "!conditions.isTaskbarFullScreen && data.narrowModeStyle === ''" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                <AwLayoutSlot name="aw_rightEdge" context={AwParseService.instance( "data" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                </AwLayoutSlot>
            </DivExistWhen>
        </div>
    </div>
    )
};


/*
define component
*/
const Component = createComponent( declViewModelJson, renderFn, undefined, ctxImportObj );

export default Component;
